import React from 'react';
import './Home.css'
import Merle from '../../../img/pups2.jpg'
// import TwoDogs from '../../../img/IMG_7224.heic'
import InstaSVG from '../../../img/instagram-brands.svg'

function Home() {
    return (
        <section className="home-section">
           <div className='container-box'>
            <div className="bottom-svg"> 
           <img className='insta-svg' src={InstaSVG} alt ="" width="30"/>
           </div>
           <img className='merle-dog' src={Merle}/>

           <div className="centered-text"> #LivingTheFrenchieLife </div>

           </div>


        </section>
    );
}

export default Home;
